INSERT INTO `documentacao` (`id_documentacao`, `titulo`, `conteudo`, `id_usuario`, `id_projeto`) VALUES
(1, 'Teste com clock DS3231', '<p>// Utilize negrito para designar os subtítulos...</p><p>// Modelo padrão:</p><p><br></p><p><b>Lista de componentes eletrônicos:</b></p><p><span style=\"color: rgb(0, 0, 0);\">1 Arduino Uno</span></p><p><span style=\"color: rgb(0, 0, 0);\">1 leitor RFID RC522</span></p><p><span style=\"color: rgb(0, 0, 0);\">1 MPU6050</span></p><p><span style=\"color: rgb(0, 0, 0);\">1 DS3231</span></p><p><b>Diagrama do circuito:</b></p><p><img src=\"data:image/png;base64,\"></p><p><b>Código-fonte:</b></p><pre class=\"ql-syntax\" spellcheck=\"false\"><span class=\"hljs-meta\">#include &lt;DS1307.h&gt;</span>\n<span class=\"hljs-meta\">#include <span class=\"hljs-string\">\"I2Cdev.h\"</span></span>\n<span class=\"hljs-meta\">#include <span class=\"hljs-string\">\"MPU6050_6Axis_MotionApps20.h\"</span></span>\n<span class=\"hljs-meta\">#include &lt;SPI.h&gt;</span>\n<span class=\"hljs-meta\">#include &lt;MFRC522.h&gt;</span>\n<span class=\"hljs-meta\">#if I2CDEV_IMPLEMENTATION == I2CDEV_ARDUINO_WIRE</span>\n<span class=\"hljs-meta\">#include <span class=\"hljs-string\">\"Wire.h\"</span></span>\n<span class=\"hljs-meta\">#endif</span>\n<span class=\"hljs-function\">DS1307 <span class=\"hljs-title\">rtc</span><span class=\"hljs-params\">(A2, A3)</span></span>;\n<span class=\"hljs-meta\">#define SS_PIN 10</span>\n<span class=\"hljs-meta\">#define RST_PIN 9</span>\n<span class=\"hljs-meta\">#define PERDA 20</span>\n\nMPU6050 mpu;\n<span class=\"hljs-keyword\">bool</span> dmpReady = <span class=\"hljs-literal\">false</span>; &nbsp;<span class=\"hljs-comment\">// set true if DMP init was successful</span>\n<span class=\"hljs-keyword\">uint8_t</span> mpuIntStatus; &nbsp;&nbsp;<span class=\"hljs-comment\">// holds actual interrupt status byte from MPU</span>\n<span class=\"hljs-keyword\">uint8_t</span> devStatus; &nbsp;	<span class=\"hljs-comment\">// return status after each device operation (0 = success, !0 = error)</span>\n<span class=\"hljs-keyword\">uint16_t</span> packetSize;	<span class=\"hljs-comment\">// expected DMP packet size (default is 42 bytes)</span>\n<span class=\"hljs-keyword\">uint16_t</span> fifoCount; 	<span class=\"hljs-comment\">// count of all bytes currently in FIFO</span>\n<span class=\"hljs-keyword\">uint8_t</span> fifoBuffer[<span class=\"hljs-number\">64</span>];\n\nQuaternion q;\n<span class=\"hljs-keyword\">float</span> ypr[<span class=\"hljs-number\">3</span>];\nVectorFloat gravity;\n\n<span class=\"hljs-keyword\">volatile</span> <span class=\"hljs-keyword\">bool</span> mpuInterrupt = <span class=\"hljs-literal\">false</span>; 	<span class=\"hljs-comment\">// indicates whether MPU interrupt pin has gone high</span>\n<span class=\"hljs-function\"><span class=\"hljs-keyword\">void</span> <span class=\"hljs-title\">dmpDataReady</span><span class=\"hljs-params\">()</span> </span>{\n	mpuInterrupt = <span class=\"hljs-literal\">true</span>;\n}\n\n<span class=\"hljs-function\">MFRC522 <span class=\"hljs-title\">mfrc522</span><span class=\"hljs-params\">(SS_PIN, RST_PIN)</span></span>;\nMFRC522::MIFARE_Key key;\n<span class=\"hljs-keyword\">int</span> fome = <span class=\"hljs-number\">100</span>;\n<span class=\"hljs-keyword\">int</span> sede = <span class=\"hljs-number\">100</span>;\nString tempo;\n<span class=\"hljs-keyword\">int</span> tempoEspera;\n\n<span class=\"hljs-function\"><span class=\"hljs-keyword\">void</span> <span class=\"hljs-title\">setup</span><span class=\"hljs-params\">()</span> </span>{\n &nbsp;<span class=\"hljs-meta\">#if I2CDEV_IMPLEMENTATION == I2CDEV_ARDUINO_WIRE</span>\n	Wire.begin();\n	TWBR = <span class=\"hljs-number\">24</span>;\n &nbsp;<span class=\"hljs-meta\">#elif I2CDEV_IMPLEMENTATION == I2CDEV_BUILTIN_FASTWIRE</span>\n	Fastwire::setup(<span class=\"hljs-number\">400</span>, <span class=\"hljs-literal\">true</span>);\n &nbsp;<span class=\"hljs-meta\">#endif</span>\n &nbsp;Serial.begin(<span class=\"hljs-number\">115200</span>);\n\n &nbsp;mpu.initialize();\n &nbsp;devStatus = mpu.dmpInitialize();\n\n &nbsp;mpu.setXGyroOffset(<span class=\"hljs-number\">220</span>);\n &nbsp;mpu.setYGyroOffset(<span class=\"hljs-number\">76</span>);\n &nbsp;mpu.setZGyroOffset(<span class=\"hljs-number\">-85</span>);\n &nbsp;mpu.setZAccelOffset(<span class=\"hljs-number\">1788</span>);\n\n &nbsp;<span class=\"hljs-keyword\">if</span> (devStatus == <span class=\"hljs-number\">0</span>) {\n	mpu.setDMPEnabled(<span class=\"hljs-literal\">true</span>);\n	attachInterrupt(<span class=\"hljs-number\">0</span>, dmpDataReady, RISING);\n	mpuIntStatus = mpu.getIntStatus();\n	dmpReady = <span class=\"hljs-literal\">true</span>;\n	packetSize = mpu.dmpGetFIFOPacketSize();\n &nbsp;} <span class=\"hljs-keyword\">else</span> {\n	<span class=\"hljs-comment\">// ERROR!</span>\n	<span class=\"hljs-comment\">// 1 = initial memory load failed</span>\n	<span class=\"hljs-comment\">// 2 = DMP configuration updates failed</span>\n	<span class=\"hljs-comment\">// (if it\'s going to break, usually the code will be 1)</span>\n	Serial.print(F(<span class=\"hljs-string\">\"DMP Initialization failed (code \"</span>));\n	Serial.print(devStatus);\n	Serial.println(F(<span class=\"hljs-string\">\")\"</span>));\n &nbsp;}\n &nbsp;tempo = rtc.getTimeStr();\n &nbsp;tempoEspera = <span class=\"hljs-number\">15</span>;\n\n &nbsp;SPI.begin();\n &nbsp;mfrc522.PCD_Init();\n &nbsp;<span class=\"hljs-keyword\">for</span> (byte i = <span class=\"hljs-number\">0</span>; i &lt; <span class=\"hljs-number\">6</span>; i++) {\n	key.keyByte[i] = <span class=\"hljs-number\">0xFF</span>;\n &nbsp;}\n &nbsp;Serial.print(<span class=\"hljs-string\">\"Fome: \"</span>);\n &nbsp;Serial.print(fome);\n &nbsp;Serial.print(<span class=\"hljs-string\">\"\\nSede: \"</span>);\n &nbsp;Serial.println(sede);\n}\n\n<span class=\"hljs-function\"><span class=\"hljs-keyword\">void</span> <span class=\"hljs-title\">loop</span><span class=\"hljs-params\">()</span> </span>{\n &nbsp;<span class=\"hljs-keyword\">if</span> (!dmpReady) return;\n\n &nbsp;<span class=\"hljs-keyword\">if</span>(testarHorario()){\n	Serial.println(<span class=\"hljs-string\">\"FOI\"</span>);\n	tempo = rtc.getTimeStr();\n &nbsp;}\n\n &nbsp;<span class=\"hljs-comment\">/*Serial.print(rtc.getTimeStr());\n &nbsp;Serial.print(\"\\t\");\n &nbsp;Serial.println(rtc.getDateStr());*/</span>\n \n &nbsp;mpuInterrupt = <span class=\"hljs-literal\">false</span>;\n &nbsp;mpuIntStatus = mpu.getIntStatus();\n\n &nbsp;fifoCount = mpu.getFIFOCount();\n\n &nbsp;<span class=\"hljs-keyword\">if</span> ((mpuIntStatus &amp; <span class=\"hljs-number\">0x10</span>) || fifoCount == <span class=\"hljs-number\">1024</span>) {\n	mpu.resetFIFO();\n	<span class=\"hljs-comment\">//Serial.println(F(\"FIFO overflow!\"));</span>\n &nbsp;} <span class=\"hljs-keyword\">else</span> <span class=\"hljs-keyword\">if</span> (mpuIntStatus &amp; <span class=\"hljs-number\">0x02</span>) {\n	<span class=\"hljs-keyword\">while</span> (fifoCount &lt; packetSize) fifoCount = mpu.getFIFOCount();\n	mpu.getFIFOBytes(fifoBuffer, packetSize);\n	fifoCount -= packetSize;\n\n	mpu.dmpGetQuaternion(&amp;q, fifoBuffer);\n	mpu.dmpGetGravity(&amp;gravity, &amp;q);\n	mpu.dmpGetYawPitchRoll(ypr, &amp;q, &amp;gravity);\n\n	<span class=\"hljs-comment\">/*\n	Serial.print(\"ypr\\t\");\n	Serial.print(ypr[0] * 180 / M_PI);\n	Serial.print(\"\\t\");\n	Serial.print(ypr[1] * 180 / M_PI);\n	Serial.print(\"\\t\");\n	Serial.println(ypr[2] * 180 / M_PI);\n	*/</span>\n &nbsp;}\n &nbsp;<span class=\"hljs-comment\">// LEITURA RFID</span>\n &nbsp;<span class=\"hljs-keyword\">if</span> ( ! mfrc522.PICC_IsNewCardPresent())\n &nbsp;{\n	return;\n &nbsp;}\n &nbsp;<span class=\"hljs-keyword\">if</span> ( ! mfrc522.PICC_ReadCardSerial())\n &nbsp;{\n	return;\n &nbsp;}\n &nbsp;byte conteudo[<span class=\"hljs-number\">18</span>];\n &nbsp;byte buffersize = <span class=\"hljs-keyword\">sizeof</span>(conteudo);\n &nbsp;String valor;\n &nbsp;MFRC522::StatusCode status;\n &nbsp;status = (MFRC522::StatusCode) mfrc522.PCD_Authenticate(MFRC522::PICC_CMD_MF_AUTH_KEY_A, <span class=\"hljs-number\">7</span>, &amp;key, &amp;(mfrc522.uid));\n &nbsp;status = (MFRC522::StatusCode) mfrc522.MIFARE_Read(<span class=\"hljs-number\">5</span>, conteudo, &amp;buffersize);\n &nbsp;<span class=\"hljs-keyword\">for</span> (<span class=\"hljs-keyword\">int</span> i = <span class=\"hljs-number\">0</span>; i &lt; <span class=\"hljs-number\">16</span>; i++) {\n	valor.concat(String(conteudo[i] &lt; <span class=\"hljs-number\">0x10</span> ? <span class=\"hljs-string\">\" 0\"</span> : <span class=\"hljs-string\">\" \"</span>));\n	valor.concat(String(conteudo[i], HEX));\n &nbsp;}\n &nbsp;valor.toUpperCase();\n &nbsp;<span class=\"hljs-keyword\">if</span> (valor.substring(<span class=\"hljs-number\">1</span>, <span class=\"hljs-number\">12</span>) == <span class=\"hljs-string\">\"46 4F 4D 45\"</span>) {\n	<span class=\"hljs-keyword\">if</span> (fome &gt;= PERDA)\n &nbsp;	fome -= PERDA;\n	<span class=\"hljs-keyword\">else</span>\n &nbsp;	fome = <span class=\"hljs-number\">0</span>;\n &nbsp;}\n &nbsp;<span class=\"hljs-keyword\">if</span> (valor.substring(<span class=\"hljs-number\">1</span>, <span class=\"hljs-number\">12</span>) == <span class=\"hljs-string\">\"53 45 44 45\"</span>) {\n	<span class=\"hljs-keyword\">if</span> (sede &gt;= PERDA)\n &nbsp;	sede -= PERDA;\n	<span class=\"hljs-keyword\">else</span>\n &nbsp;	sede = <span class=\"hljs-number\">0</span>;\n &nbsp;}\n &nbsp;atualizarDados();\n &nbsp;mfrc522.PICC_HaltA();\n &nbsp;mfrc522.PCD_StopCrypto1();\n}\n\n<span class=\"hljs-function\"><span class=\"hljs-keyword\">void</span> <span class=\"hljs-title\">atualizarDados</span><span class=\"hljs-params\">()</span> </span>{\n &nbsp;Serial.print(<span class=\"hljs-string\">\"\\n\\n\\n\\nFome: \"</span>);\n &nbsp;Serial.print(fome);\n &nbsp;Serial.print(<span class=\"hljs-string\">\"\\nSede: \"</span>);\n &nbsp;Serial.println(sede);\n}\n\n<span class=\"hljs-function\">boolean <span class=\"hljs-title\">testarHorario</span><span class=\"hljs-params\">()</span></span>{\n &nbsp;<span class=\"hljs-keyword\">long</span> <span class=\"hljs-keyword\">int</span> segundosInicio = <span class=\"hljs-number\">0</span>;\n &nbsp;<span class=\"hljs-keyword\">long</span> <span class=\"hljs-keyword\">int</span> segundosAtual = <span class=\"hljs-number\">0</span>;\n &nbsp;String atual = rtc.getTimeStr();\n \n &nbsp;<span class=\"hljs-keyword\">if</span>(tempo.substring(<span class=\"hljs-number\">0</span>,<span class=\"hljs-number\">2</span>).toInt() &gt; <span class=\"hljs-number\">0</span>){\n	segundosInicio += tempo.substring(<span class=\"hljs-number\">0</span>,<span class=\"hljs-number\">2</span>).toInt() * <span class=\"hljs-number\">3600</span>; &nbsp;&nbsp;\n &nbsp;}\n &nbsp;<span class=\"hljs-keyword\">if</span>(tempo.substring(<span class=\"hljs-number\">3</span>,<span class=\"hljs-number\">5</span>).toInt() &gt; <span class=\"hljs-number\">0</span>){\n	segundosInicio += tempo.substring(<span class=\"hljs-number\">3</span>,<span class=\"hljs-number\">5</span>).toInt() * <span class=\"hljs-number\">60</span>; &nbsp;&nbsp;\n &nbsp;}\n &nbsp;<span class=\"hljs-keyword\">if</span>(tempo.substring(<span class=\"hljs-number\">6</span>,<span class=\"hljs-number\">8</span>).toInt() &gt; <span class=\"hljs-number\">0</span>){\n	segundosInicio += tempo.substring(<span class=\"hljs-number\">6</span>,<span class=\"hljs-number\">8</span>).toInt(); &nbsp;&nbsp;\n &nbsp;}\n\n &nbsp;<span class=\"hljs-keyword\">if</span>(atual.substring(<span class=\"hljs-number\">0</span>,<span class=\"hljs-number\">2</span>).toInt() &gt; <span class=\"hljs-number\">0</span>){\n	segundosAtual += atual.substring(<span class=\"hljs-number\">0</span>,<span class=\"hljs-number\">2</span>).toInt() * <span class=\"hljs-number\">3600</span>; &nbsp;&nbsp;\n &nbsp;}\n &nbsp;<span class=\"hljs-keyword\">if</span>(atual.substring(<span class=\"hljs-number\">3</span>,<span class=\"hljs-number\">5</span>).toInt() &gt; <span class=\"hljs-number\">0</span>){\n	segundosAtual += atual.substring(<span class=\"hljs-number\">3</span>,<span class=\"hljs-number\">5</span>).toInt() * <span class=\"hljs-number\">60</span>; &nbsp;&nbsp;\n &nbsp;}\n &nbsp;<span class=\"hljs-keyword\">if</span>(atual.substring(<span class=\"hljs-number\">6</span>,<span class=\"hljs-number\">8</span>).toInt() &gt; <span class=\"hljs-number\">0</span>){\n	segundosAtual += atual.substring(<span class=\"hljs-number\">6</span>,<span class=\"hljs-number\">8</span>).toInt(); &nbsp;&nbsp;\n &nbsp;}\n \n &nbsp;<span class=\"hljs-keyword\">if</span>(segundosInicio + tempoEspera &lt;= segundosAtual){\n	return <span class=\"hljs-literal\">true</span>;\n &nbsp;}\n &nbsp;return <span class=\"hljs-literal\">false</span>;\n}\n</pre><p><b>Especificação:</b></p><p><span style=\"color: rgb(0, 0, 0);\">Foi utilizada a biblioteca DS1037 para definir e recuperar horas e datas. A partir da informação de horas, minutos e segundos foi possível a criação de uma função que pudesse converter a hora atual e a hora de início de uma atividade em segundos, permitindo a utilização de delays que sirvam somente para uma parte do código, sem interferir nas outras. Além disso, a informação de data e horários será utilizada para a criação de relatórios futuramente.</span></p><p><b>Área de aplicação:</b></p><p><span style=\"color: rgb(0, 0, 0);\">Programação</span></p><p><b>Observações gerais:</b></p><p><span style=\"color: rgb(0, 0, 0);\">Resultado satisfatório</span></p>', 1, 1);
